import React from "react";
import styled from "styled-components";
import check from "..//images/check.png";

const Wrapper = styled.div``;

const MainText = styled.h1``;

const Message = styled.p``;

class Develop extends React.Component {
	render() {
		return (
			<Wrapper>
				<MainText>
					Your Strategy is onlu as good <br /> as your ability to execute it.
				</MainText>
				<Message>
					Perdoo is a simple but powerful toolkit for turning great
					<br />
					strategies into amaizing results. And it is free.
				</Message>
				<div>
					<img src={check} />
					<p>Free forever</p>
				</div>
			</Wrapper>
		);
	}
}

export default Develop;
